var angle = 0;
var song;
var particle = [];
var font;
var drawing;
var y = [];
var x = [];
let fort;
let c = [];
let e = 0;

function preload() {
    song = loadSound("Song.mp3");
}    

function setup() {
    let t = 0;
    createCanvas(windowWidth, windowHeight);
    
    for(let i = 0; i < nameKhepi.length; i+=2) {
        x.push(nameKhepi[i].x);
        y.push(nameKhepi[i].y);
    }
    fortY = dft(y);
    fortX = dft(x);

    fortX.sort((a, b) => b.amp - a.amp);
    fortY.sort((a, b) => b.amp - a.amp);
    
    song.play();
}
function draw() {
    background(17);
    const p = fortY.length;

    strokeWeight(1);
    let vy = epicycles(100, 400, fortY, HALF_PI);
    let vx = epicycles(800, 100, fortX, 0);
    let v = createVector(vx.x , vy.y);
    particle.unshift(v);

    line(vx.x, vx.y, v.x, v.y);
    line(vy.x, vy.y, v.x, v.y);

    beginShape();
    noFill();
    for(let i = 0 ; i < particle.length ; i++)
    {
        vertex(particle[i].x, particle[i].y);
    }
    endShape();

    if(particle.length > width) {
        particle.pop();
    }


    fill(150, 0, 100, 100);
    translate(width/2 , height/2 + 200);
    strokeWeight(8);
    beginShape();
    for(let i = 0; i < c.length; i++) {
        vertex(c[i].x, c[i].y);
    }
    endShape(CLOSE)

    x = 10 * 16 * pow(sin(e), 3);
    y = -10 * ((13 * cos(e)) - (5 * cos(2 * e)) - (2 * cos(3 * e)) - cos(4 * e));
    c.push(createVector(x, y));
    e += 0.01;

    angle += TWO_PI/p;
}


function epicycles(x, y, fort, rot) {
    for(let i = 0; i < fort.length; i++) {
        let prevx = x;
        let prevy = y;

        stroke(255, 100);
        noFill();

        let n = fort[i].freq;
        let radius = fort[i].amp;
        let phase = fort[i].phs;

        x += radius * cos(( n * angle ) + phase + rot);
        y += radius * sin(( n * angle ) + phase + rot);

        
        noFill();
        circle(prevx, prevy, radius*2);

        stroke(255, 255);
        line(prevx, prevy, x, y);
    }
    return createVector(x, y);
}


function dft(val) {
    let rets = [];
    const N = val.length;
    for(let i = 0 ; i < N ; i++)
    {
        let re = 0;
        let im = 0;
        for(let j = 0 ; j < N ; j++)
        {
            const phi = TWO_PI * i * j / N;
            re += val[j] * cos(phi);
            im -= val[j] * sin(phi);
        }
        re = re / N;
        im = im / N;

        let freq = i;
        let amp = sqrt((re*re) + (im*im));
        let phs = atan2(im, re);
        rets[i] = { re, im, freq, amp, phs };
    }
    return rets;
}



